     ES-SV'>ABORTO ESPONTÁNEO.<o:p></o:p></span></p>
     <p class=MsoNormal style='text-align:justify'><span lang=ES-MX
     style='font-size:14.0pt;line-height:107%;font-family:"Times New Roman",serif;
     mso-fareast-font-family:"Times New Roman";color:black;mso-ansi-language:
     ES-MX;mso-fareast-language:ES-SV'>Se considera aborto espontáneo a la
     pérdida de la gestación antes de las&nbsp;26 semanas, cuando el feto no
     está aún en condiciones de sobrevivir con garantías&nbsp;fuera del útero
     materno. Un aborto espontáneo ocurre cuando un embarazo termina de manera
     abrupta. Un 8 y 15 por ciento de los embarazos.</span><span
     style='font-size:14.0pt;line-height:107%;font-family:"Times New Roman",serif;

     ES-SV'>ABORTO FRUSTRO.<o:p></o:p></span></p>
     <p class=MsoNormal style='text-align:justify'><span lang=EN-US
     style='font-size:14.0pt;line-height:107%;font-family:"Times New Roman",serif;
     mso-fareast-font-family:"Times New Roman";color:black;mso-ansi-language:
     EN-US;mso-fareast-language:ES-SV'>La <span class=SpellE>retención</span>
     del <span class=SpellE>embrión</span> <span class=SpellE>en</span> la <span
     class=SpellE>cavidad</span> <span class=SpellE>uterina</span> por lo <span
     class=SpellE>menos</span> <span class=SpellE>durante</span>&nbsp;4 <span
     class=SpellE>semanas</span> <span class=SpellE>después</span> de <span
     class=SpellE>su</span> <span class=SpellE>muerte</span>, se <span
     class=SpellE>conoce</span> <span class=SpellE>como</span> <span
     class=SpellE>aborto</span> <span class=SpellE>frustro</span>. <span
     class=SpellE>Definir</span> <span class=SpellE>el</span> <span
     class=SpellE>tiempo</span> entre la <span class=SpellE>muerte</span> y <span
     class=SpellE>el</span> <span class=SpellE>diagnóstico</span> es <span
     class=SpellE>difícil</span>.</span><span style='font-size:14.0pt;
     line-height:107%;font-family:"Times New Roman",serif;mso-fareast-font-family:
     "Times New Roman";color:black;mso-fareast-language:ES-SV'><o:p></o:p></span></p>
